function Food({ name, url }) {
  return (
    <div>
      <h1>i like {name}</h1>
      <img src={url} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  url: PropTypes.string,
};

function App() {
  return (
    <div className="App">
      {foods.map((dish) => (
        <Food key={dish.name} name={dish.name} url={dish.url} />
      ))}
    </div>
  );
}

