//setState

class App extends React.Component {
  constructor(props) {
    super(props);
    console.log("constuctor");
  }
  state = {
    count: 1,
  };
  componentDidMount() {
    console.log("finish render");
  }
  render() {
    console.log("rendering");
    return (
      <div>
        <h1>The number is:{this.state.count} </h1>
        <h1>The number is:{this.state.countt} </h1>
        <button onClick={this.plus}>+</button>
        <button onClick={this.minus}>-</button>
      </div>
    );
  }
  plus = () => {
    //일반 js function에서는 this가 undefined이다. plus(){ } 사용시 에러
    this.setState((current) => {
      //current = this.state를 해줌
      return { count: current.count + 1 }; //setState는 새로운 state를 설정해주는데 덮어씌우는 방식이 아닌 변경된 사항을 합친다
    });
    this.setState({ countt: 5 }); //stateobj 을 넣어야함
  };
  minus = () => {
    this.setState((current) => {
      return (current.count -= 1);
    });
  };
  componentDidUpdate() {
    console.log("updated");
  }
}
